import React from "react";
import "./Contact.css";

function Contact() {
  return (
    <div className="contact-page">
      <h1>Contact Me</h1>
      <p>Email: yourname@example.com</p>
      <p>Phone: +92-300-1234567</p>
    </div>
  );
}

export default Contact;
